import React from "react";
import styles from '../App.css';
import FullRecordList from "./FullRecordList";
import capitalize from "../capitalize"

const Address = ({addr}) => {
  return (
    <div>
      <div style={{marginBottom: '10px'}}>
        <h3>АДРЕСС</h3>
        <strong>Город: </strong> {capitalize(addr.city)}, <strong>улица:</strong> {capitalize(addr.street)}, <strong>дом:</strong> {addr.house}, <strong>квартира:</strong> {addr.office}
      </div>
      <FullRecordList recs={addr.full_records} />
    </div>
  );
};

export default Address;
